        if (typeof identifierEI !== "undefined")
        {
            onetAds.kropka['EI'] = identifierEI;
        }


        onetAds.cmd.push(function (dlApi){

            var idGenerator = createIdGenerator();
            var htmlblock   = document.querySelectorAll(".htmlblockslot");

            for (var i=0; i<htmlblock.length; i++) {
                configureSlot(htmlblock[i]);
            }

            function configureSlot(adDom) {

                var id      = idGenerator.get();
                var keyword = adDom.getAttribute("data-slot-keyword");

                adDom.setAttribute("id", id);

                var slot = onetAds.defineSlot('flat-autopromo', id);
                slot.setTargeting('kwrd', keyword);
            }

            function createIdGenerator() {

                var counter = 1;

                return {
                    get : get
                };

                function get() {

                    var num = counter;
                    counter++;
                    return "htmlblockslot_id_" + num;
                }
            }
            dlApi.registerTemplate({
                tplCode: "1746213/Teaser-Standard",
                renderAd: function (Ad, dlApi, window) {
                    var lastLi = document.querySelector('.artRight .rightPart1 ul.Article-List-Whole li:last-child');
                    var nr = parseInt(lastLi.querySelector('a span.nr').innerHTML) + 1;
                    var newElem = document.getElementById(Ad.div);
                    var link = document.createElement('a');
                    link.setAttribute('href', Ad.meta.adclick + Ad.fields.url);
                    if (Ad && Ad.fields && Ad.fields.title) {
                        var adInfo = Ad.fields.adInfo || '';
                        link.innerHTML = '<span class="nr">'+ nr +'</span>' +
                                    '<div class="text">' +
                                        '<span>'+ Ad.fields.title +'</span>' +
                                        '<span id="adInfo">' + adInfo + '</span>' +
                                    '</div>';
                        if (Ad.fields.partner_logo){
                            link.innerHTML += '<div class="logoWrapper">' +
                                                '<img src=' + Ad.fields.image + '>' +
                                            '</div>';
                        }
                    }
                    newElem.appendChild(link);
                }
            });
        });

